"use strict";(self.webpackChunkudonarium=self.webpackChunkudonarium||[]).push([[4502],{408:e=>{e.exports=JSON.parse('{"ko_kr":{"DetatokoSaga":{"DS":{"input_options":"\ud310\uc815\uff01\u3000\uc2a4\ud0ac\ub808\ubca8\uff1a%{skill}\u3000\ud50c\ub798\uadf8\uff1a%{flag}\u3000\ubaa9\ud45c\uce58\uff1a%{target}","modifier":"\u3000\uc218\uc815\uce58\uff1a%{modifier}","success":"\ubaa9\ud45c\uce58 \uc774\uc0c1\uff01\u3010\uc131\uacf5\u3011","failure":"\ubaa9\ud45c\uce58 \ubbf8\ub2ec\u2026 \u3010\uc2e4\ud328\u3011"},"JD":{"input_options":"\ud310\uc815\uff01\u3000\uc2a4\ud0ac\ub808\ubca8\uff1a%{skill}\u3000\ud50c\ub798\uadf8\uff1a%{flag}","modifier":"\u3000\uc218\uc815\uce58\uff1a%{modifier}"},"total_value":"\ud310\uc815\uce58\uff1a%{total}","less_than_flag":", \ud50c\ub798\uadf8 \uc774\ud558\uff01 \u3010\uae30\ub825%{will}\uc810 \uac10\uc18c\u3011 \u3010\ud310\uc815\uce58 \ubcc0\uacbd \ubd88\uac00\u3011","division_by_zero_error":"0\uc73c\ub85c\ub294 \ub098\ub204\uc5b4\uc9c0\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4","table":{"SST":{"name":"\uccb4\ub825 \ub099\uc778\ud45c","type":"2D6","items":["\ub2f9\uc2e0\uc740 \u3010\ub099\uc778\u3011\uc744 2\uac1c \ubc1b\ub294\ub2e4. \uc774 \ud45c\ub97c \ub2e4\uc2dc 2\ubc88 \uad74\ub824 \ubc1b\uc744 \u3010\ub099\uc778\u3011\uc744 \uc815\ud55c\ub2e4(\uadf8 \uacbd\uc6b0, \ub2e4\uc2dc \uc774 \ub208\uc774 \ub098\uc640\ub3c4 \u3010\ub099\uc778\u3011\uc740 \ub298\uc5b4\ub098\uc9c0 \uc54a\ub294\ub2e4).","\u3010\uc0c1\ucc98\u3011 \uc2ec\ud55c \uc0c1\ucc98\ub97c \uc785\uc5c8\ub2e4. \uc5b4\ub5bb\uac8c\ub4e0 \uc2f8\uc6b8 \uc218\ub294 \uc788\uc9c0\ub9cc\u2026\u2026.","\u3010\ucd9c\ud608\u3011 \ud53c\uac00 \ud758\ub7ec\ub118\uccd0, \ub208\uc774 \ud750\ub9bf\ud558\ub2e4\u2026\u2026.","\u3010\uc1e0\uc57d\u3011 \ubab8\uc774 \uc57d\ud574\uc838, \uadf8 \ub9c8\uc74c\ub9c8\uc800\ub3c4 \uc2dc\ub4e4\uc5b4\ubc84\ub9b4 \uac70 \uac19\ub2e4.","\u3010\uace0\ud1b5\u3011 \uc544\ud514\uacfc \uad34\ub85c\uc6c0, \ud55c\uc2ec\ud568. \ub208\uc5d0\uc11c \ub208\ubb3c\uc774 \uc0c8\uc5b4 \ub098\uc628\ub2e4.","\u3010\ucda9\uaca9\u3011 \ub0a0\ub824\uc838\uc11c, \ubcbd\uc774\ub098 \ub098\ubb34\uc5d0 \ubd80\ub52a\ud78c\ub2e4. \ube68\ub9ac \uc77c\uc5b4\uc11c\uc9c0 \uc54a\uc73c\uba74.","\u3010\ud53c\ub85c\u3011 \ub2f9\uc2e0\uc758 \uc5bc\uad74\uc5d0 \ud53c\ub85c\uc758 \uc0c9\uc774 \uac15\ud574\uc9c4\ub2e4\u2026\u2026\uc774 \uc2f8\uc6c0\uc774 \ud798\uaca8\uc6cc\uc84c\ub2e4.","\u3010\ub178\ud638\u3011 \uc131\uac00\uc2e0 \uacf5\uaca9\uc5d0 \ubd84\ub178\uc758 \ud568\uc131\uc744 \uc9c0\ub978\ub2e4. \ubd84\ub178\uac00 \uc2f8\uc6c0\uc744 \uc5b4\ub835\uac8c \ud560\uae4c?","\u3010\ubd80\uc0c1\u3011 \uc0c1\ucc98\ub97c \uc785\uc5c8\ub2e4\u2026\u2026.","\u3010\uacbd\uc0c1\u3011 \ub2f9\uc2e0\uc758 \ud53c\ubd80\uc5d0 \uc0c1\ucc98\uac00 \ub0a8\uc558\ub2e4. \uc774\uac83\ub9cc\uc774\ub77c\uba74 \uc544\ubb34\ub807\uc9c0\ub3c4 \uc54a\ub2e4.","\uae30\uc801\uc801\uc73c\ub85c \ub2f9\uc2e0\uc740 \u3010\ub099\uc778\u3011\uc744 \ubc1b\uc9c0 \uc54a\uc558\ub2e4."]},"WST":{"name":"\uae30\ub825 \ub099\uc778\ud45c","type":"2D6","items":["\ub2f9\uc2e0\uc740 \u3010\ub099\uc778\u3011\uc744 2\uac1c \ubc1b\ub294\ub2e4. \uc774 \ud45c\ub97c \ub2e4\uc2dc 2\ubc88 \uad74\ub824 \ubc1b\uc744 \u3010\ub099\uc778\u3011\uc744 \uc815\ud55c\ub2e4(\uadf8 \uacbd\uc6b0, \ub2e4\uc2dc \uc774 \ub208\uc774 \ub098\uc640\ub3c4 \u3010\ub099\uc778\u3011\uc740 \ub298\uc5b4\ub098\uc9c0 \uc54a\ub294\ub2e4).","\u3010\uc808\ub9dd\u3011 \uc5b4\ub5bb\uac8c \ud558\uc9c0 \ubabb\ud558\ub294 \uc0c1\ud669. \ud76c\ub9dd\uc740 \uc0ac\ub77c\uc9c0\uace0\u2026\u2026\ubb34\ub98e\uc744 \uafc7\uc744 \uc218\ubc16\uc5d0 \uc5c6\ub2e4.","\u3010\ud1b5\uace1\u3011 \ub108\ubb34\ub3c4 \ubd80\uc870\ub9ac\ud568\uc5d0, \uc5b4\ub9b0\uc544\uc774\ucc98\ub7fc \uc6b8\uc74c\uc744 \ud130\ud2b8\ub9b4 \uc218\ubc16\uc5d0 \uc5c6\ub2e4.","\u3010\ud6c4\ud68c\u3011 \uc774\ub7f4 \uc0dd\uac01\uc740 \uc544\ub2c8\uc5c8\ub294\ub370. \ud558\uc9c0\ub9cc \ud604\uc2e4\uc740 \ube44\uc815\ud588\ub2e4.","\u3010\uacf5\ud3ec\u3011 \uacf5\ud3ec\uc5d0 \uc0ac\ub85c\uc7a1\ud614\ub2e4! \uc801\uc774, \uc790\uc2e0\uc758 \uc190\uc774, \ubb34\uc11c\uc6cc\uc11c \ucc38\uc744 \uc218 \uc5c6\ub2e4!","\u3010\uac08\ub4f1\u3011 \uc815\ub9d0\ub85c \uc774\uac78\ub85c \uad1c\ucc2e\uc740 \uac78\uae4c? \uba87 \ubc88\uc774\uace0 \uc790\uc2e0\uc5d0\uac8c \uc758\ubb38\uc774 \uc77c\uc5b4\ub09c\ub2e4\u2026\u2026.","\u3010\uc99d\uc624\u3011 \ubd84\ub178\uc640 \uc99d\uc624\uc5d0 \uc0ac\ub85c\uc7a1\ud78c \ub2f9\uc2e0\uc740, \ubcf8\ub798\uc758 \ud798\uc744 \ubc1c\ud718\ud560 \uc218 \uc788\uc744\uae4c?","\u3010\ub9dd\uc5f0\u3011 \uc774\uac83\uc740 \ud604\uc2e4\uc778\uac00? \ubabd\ub871\ud55c \uc815\uc2e0\uc73c\ub85c \ub2f9\uc2e0\uc740 \uc0dd\uac01\ud55c\ub2e4.","\u3010\uc8fc\uc800\u3011 \ub9dd\uc124\uc784\uc744 \uac00\uc84c\ub2e4. \uadf8\uac83\uc740 \uc2f8\uc6b8 \uc758\uc9c0\ub97c \ub454\ud558\uac8c \ud560 \uac83\uc778\uac00?","\u3010\uc545\ubabd\u3011 \uc774\uc81c\ubd80\ud130 \ub54c\ub54c\ub85c, \ub2f9\uc2e0\uc740 \uc774 \uc21c\uac04\uc744 \uc545\ubabd\uc73c\ub85c \ubcfc \uac83\uc774\ub2e4.","\uae30\uc801\uc801\uc73c\ub85c \ub2f9\uc2e0\uc740 \u3010\ub099\uc778\u3011\uc744 \ubc1b\uc9c0 \uc54a\uc558\ub2e4."]},"SBET":{"name":"\uccb4\ub825 \ubc30\ub4dc\uc5d4\ub529\ud45c","type":"2D6","items":["\u3010\uc0ac\ub9dd\u3011 \ub2f9\uc2e0\uc740 \uc8fd\uc5c8\ub2e4. \ub2e4\uc74c \uc138\uc158\uc5d0 \ucc38\uac00\ud558\uae30 \uc704\ud574\uc11c\ub294, \ud074\ub798\uc2a4 1\uac1c\ub97c \u300e\ubaac\uc2a4\ud130\u300f\ub098 \u300e\uc554\ud751\u300f\uc73c\ub85c \ud074\ub798\uc2a4 \uccb4\uc778\uc9c0\ud574\uc57c\ub9cc \ud55c\ub2e4.","\u3010\ubaa9\uc228 \uad6c\uac78\u3011 \ub2f9\uc2e0\uc740 \uacf5\ud3ec\ub97c \ub290\uaef4, \ubaa9\uc228\uc744 \uad6c\uac78\ud588\ub2e4! \ub2e4\uc74c \uc138\uc158 \uac1c\uc2dc \uc2dc\uc5d0, \ud074\ub798\uc2a4 1\uac1c\uac00 \u300e\uc790\ucf54\u300f\ub85c \ubcc0\uacbd\ub41c\ub2e4!","\u3010\ub9dd\uac01\u3011 \ub2f9\uc2e0\uc740 \uae30\uc5b5\uc744 \uc783\uace0, \uc6b0\ub450\ucee4\ub2c8 \uc130\ub2e4. \ub2e4\uc74c \uc138\uc158\uc5d0 \ucc38\uac00\ud558\uae30 \uc704\ud574\uc11c\ub294, \ud074\ub798\uc2a4 1\uac1c\ub97c \ubcc0\uacbd\ud574\uc57c\ub9cc \ud55c\ub2e4.","\u3010\ube44\uadf9\u3011 \ub2f9\uc2e0\uc758 \uacf5\uaca9\uc740 \uc801\uc774 \uc544\ub2c8\ub77c \uc544\uad70\uc744 \ub9de\ucdc4\ub2e4! \ubaa8\ub4e0 \uac83\uc774 \ub05d\ub0a0 \ub54c\uae4c\uc9c0 \ub2f9\uc2e0\uc740 \uc6b0\ub450\ucee4\ub2c8 \uc11c \uc788\uac8c \ub41c\ub2e4. \uc784\uc758\uc758 \uc544\uad70\uc758 \u3010\uccb4\ub825\u3011\uc744 1D6\uc810 \uac10\uc18c\uc2dc\ud0a8\ub2e4.","\u3010\ud3ed\uc8fc\u3011 \ub2f9\uc2e0\uc740 \uc774\uc131\uc744 \uc783\uace0, \ucda9\ub3d9\uc5d0 \ub530\ub77c \ud3ed\uc8fc\ud55c\ub2e4! \uac19\uc740 \uc52c\uc5d0 \uc788\ub294 \uc804\uc6d0\uc758 \u3010\uccb4\ub825\u3011\uc744 1D6\uc810 \uac10\uc18c\uc2dc\ud0a8\ub2e4.","\u3010\uc804\ub77d\u3011 \ub2f9\uc2e0\uc740 \ub2e8\uc560\uc808\ubcbd\uc5d0\uc11c \ub5a8\uc5b4\uc9c4\ub2e4.","\u3010\ud3ec\ub85c\u3011 \ub2f9\uc2e0\uc740 \uc801\uc5d0\uac8c \uc0ac\ub85c\uc7a1\ud614\ub2e4.","\u3010\ub3c4\uc8fc\u3011 \ub2f9\uc2e0\uc740 \uac81\uc5d0 \uc9c8\ub824, \ub3d9\ub8cc\ub97c \ubc84\ub9ac\uace0 \ub3c4\ub9dd\ucce4\ub2e4.","\u3010\uc911\uc0c1\u3011 \ub2f9\uc2e0\uc740 \uc5b4\ucc0c\ud560 \uc218 \uc5c6\ub294 \uc0c1\ucc98\ub97c \uc785\uace0, \uc4f0\ub7ec\uc84c\ub2e4.","\u3010\uae30\uc808\u3011 \ub2f9\uc2e0\uc740 \uc758\uc2dd\uc744 \uc783\uc5c8\ub2e4. \uadf8\ub9ac\uace0 \uc815\uc2e0\uc774 \ub4e4\uba74 \ubaa8\ub4e0 \uac83\uc774 \ub05d\ub098\uc788\uc5c8\ub2e4.","\uadf8\ub798\ub3c4 \uc544\uc9c1 \uc77c\uc5b4\uc120\ub2e4! \ub2f9\uc2e0\uc740 \ubc30\ub4dc\uc5d4\ub4dc\ub97c \ub9de\uc774\ud558\uc9c0 \uc54a\uc558\ub2e4. \uccb4\ub825\uc758 \u3010\ub099\uc778\u3011\uc744 1\uac1c \uc9c0\uc6cc\ub3c4 \uc88b\ub2e4."]},"WBET":{"name":"\uae30\ub825 \ubc30\ub4dc\uc5d4\ub529\ud45c","type":"2D6","items":["\u3010\uc790\ud574\u3011 \ub2f9\uc2e0\uc740 \uc2a4\uc2a4\ub85c \uc8fd\uc74c\uc744 \uace8\ub790\ub2e4. \ub2e4\uc74c \uc138\uc158\uc5d0 \ucc38\uac00\ud558\uae30 \uc704\ud574\uc11c\ub294 \ud074\ub798\uc2a4 1\uac1c\ub97c \u300e\uc554\ud751\u300f\uc73c\ub85c \ud074\ub798\uc2a4 \uccb4\uc778\uc9c0\ud574\uc57c\ub9cc \ud55c\ub2e4.","\u3010\ud0c0\ub77d\u3011 \ub2f9\uc2e0\uc740 \ub9c8\uc74c\uc18d\uc758 \uc5b4\ub460\uc5d0 \uba39\ud614\ub2e4. \ub2e4\uc74c \uc138\uc158 \uac1c\uc2dc \uc2dc\uc5d0, \ud074\ub798\uc2a4 1\uac1c\uac00 \u300e\uc554\ud751\u300f\uc774\ub098 \u300e\ubaac\uc2a4\ud130\u300f\ub85c \ubcc0\uacbd\ub41c\ub2e4!","\u3010\uc608\uc18d\u3011 \ub2f9\uc2e0\uc740 \uc801\uc758 \ub9d0\uc5d0 \uac70\uc2a4\ub97c \uc218 \uc5c6\ub2e4. \ub2e4\uc74c \uc138\uc158\uc5d0 \ub2f9\uc2e0\uc758 \uc2a4\ud0e0\uc2a4\ub294 \u300e\uc885\uc18d\u300f\uc774 \ub41c\ub2e4.","\u3010\ubc30\ubc18\u3011 \ubc30\ubc18\uc758 \ucda9\ub3d9. \uc784\uc758\uc758 \uc544\uad70\uc758 \u3010\uccb4\ub825\u3011\uc744 1D6\uc810 \uac10\uc18c\uc2dc\ud0a4\uace0, \uadf8 \uc790\ub9ac\uc5d0\uc11c \ub3c4\ub9dd\uce5c\ub2e4.","\u3010\ud3ed\uc8fc\u3011 \ub2f9\uc2e0\uc740 \uc774\uc131\uc744 \uc783\uace0, \ucda9\ub3d9\uc5d0 \ub530\ub77c \ud3ed\uc8fc\ud55c\ub2e4! \uac19\uc740 \uc52c\uc5d0 \uc788\ub294 \uc804\uc6d0\uc758 \u3010\uccb4\ub825\u3011\uc744 1D6\uc810 \uac10\uc18c\uc2dc\ud0a8\ub2e4.","\u3010\uc800\uc8fc\u3011 \ub9c8\uc74c\uc758 \uc5b4\ub460\uc774 \ud604\uc7ac\ud654\ud55c \uac83\uc778\uac00. \uc801\uc758 \uc6d0\ud55c\uc778\uac00. \uc800\uc8fc\uc5d0 \uc0bc\ucf1c\uc9c4 \ub2f9\uc2e0\uc740, \uadf8\uc800 \uace0\ud1b5\uc5d0 \ubab8\ubd80\ub9bc\uce60 \uc218\ubc16\uc5d0 \uc5c6\ub2e4.","\u3010\ud3ec\ub85c\u3011 \ub2f9\uc2e0\uc740 \uc801\uc5d0\uac8c \uc0ac\ub85c\uc7a1\ud600, \uadf8 \uc790\ub9ac\uc5d0\uc11c \ub04c\ub824\uac14\ub2e4.","\u3010\ub3c4\uc8fc\u3011 \ub2f9\uc2e0\uc740 \uac81\uc5d0 \uc9c8\ub824, \ub3d9\ub8cc\ub97c \ubc84\ub9ac\uace0 \ub3c4\ub9dd\ucce4\ub2e4.","\u3010\ubc29\uc2ec\u3011 \ub2f9\uc2e0\uc740 \uadf8\uc800 \uba4d\ud558\ub2c8 \uc11c \uc788\uc744 \uc218\ubc16\uc5d0 \uc5c6\ub2e4. \uc815\uc2e0\uc744 \ucc28\ub838\uc744 \ub54c, \ubaa8\ub4e0 \uac83\uc740 \ub05d\ub098\uc788\uc5c8\ub2e4.","\u3010\uae30\uc808\u3011 \ub2f9\uc2e0\uc740 \uc758\uc2dd\uc744 \uc783\uc5c8\ub2e4. \uadf8\ub9ac\uace0 \uc815\uc2e0\uc774 \ub4e4\uba74 \ubaa8\ub4e0 \uac83\uc774 \ub05d\ub098\uc788\uc5c8\ub2e4.","\uadf8\ub798\ub3c4 \uc544\uc9c1 \ud3ec\uae30\ud558\uc9c0 \uc54a\uc544! \ub2f9\uc2e0\uc740 \ubc30\ub4dc\uc5d4\ub4dc\ub97c \ub9de\uc774\ud558\uc9c0 \uc54a\uc558\ub2e4. \uae30\ub825\uc758 \u3010\ub099\uc778\u3011\uc744 1\uac1c \uc9c0\uc6cc\ub3c4 \uc88b\ub2e4."]}}}}}')}}]);